package projectspring.pokedex.model.entity;import lombok.*;import javax.persistence.*;@Setter@Getter@AllArgsConstructor@NoArgsConstructor@Builder@Entity@Table(name = "pokemons")public class Pokemon {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    @Column(name = "id")    private Long id;    @Column(name = "name")    private String name;    @Column(name = "type")    private String type;    @Column(name = "power")    private String power;    @Column(name = "status")    private String status;}